<script> 
  
  document.addEventListener('DOMContentLoaded', function() {
    var elems = document.querySelectorAll('select');
    var instances = M.FormSelect.init(elems);

    document.getElementById("btn").addEventListener("click", calculationExec);

  function zoomIn() {
    Logger.log("Zooming in the View");
  }
  
  function zoomOut() {
    Logger.log("Zooming out the View");
  
  }
  
  function resetZoom() {
    Logger.log("Resetting View");
  }

  
  function calculationExec() {

    hideShow("loader");
  
    var userInput = {};
    // General user info
    userInput.input1 = document.getElementById("input1").value;
    userInput.input2 = document.getElementById("input2").value;
    userInput.age = document.getElementById("ageIn").value;
    
    // Housing
    userInput.municipality = document.getElementById("municipality").selectedOptions[0].text;
    userInput.housingType = document.getElementById("housingType").selectedOptions[0].text;
    userInput.houseAge = document.getElementById("houseAge").selectedOptions[0].text;
    userInput.heatSource = document.getElementById("heatSource").selectedOptions[0].text;
    userInput.residents = document.getElementById("residents").value;
    
    // Travelling
    userInput.fuelType = document.getElementById("fuelType").selectedOptions[0].text;
    userInput.fuelConsumption = document.getElementById("fuelConsumption").value;
    userInput.annualDriving = document.getElementById("kmOut").value;
    
    userInput.chart = document.getElementById("chart").value;
    google.script.run
    .withSuccessHandler(parseReturnData)
    .userClicked(userInput);
  }



function hideShow(id) {
  var x = document.getElementById(id);
  if (x.style.display == "block") {
    x.style.display = "none";
  } else {
    x.style.display = "block";
  }
}

  position:'bottomleft'
}).addTo(map)


L.Control.Watermark = L.Control.extend({
  onAdd: function(map) {
  var img = L.DomUtil.create('img');

  img.src = 'https://upload.wikimedia.org/wikipedia/commons/6/60/Aalto_University_logo.svg';
  img.style.width = '70px';

  return img;
  },

  onRemove: function(map) {
  // Nothing to do here
  }
  });

  L.control.watermark = function(opts) {
  return new L.Control.Watermark(opts);
  }

  L.control.watermark({ position: 'bottomright' }).addTo(map);


function style(feature) {
    return {
        fillColor: getColor(feature.properties.LANDAREA),
        weight: 1,
        opacity: 1,
        color: 'white',
        fillOpacity: 0.5
    };
}
L.geoJson(kunnat, {style: style}).addTo(map);

function getColor(d) {
    return d > 10000 ? '#800026' :
           d > 5000  ? '#BD0026' :
           d > 2000  ? '#E31A1C' :
           d > 1000  ? '#FC4E2A' :
           d > 500   ? '#FD8D3C' :
           d > 200   ? '#FEB24C' :
           d > 100   ? '#FED976' :
                       '#FFEDA0';
}
  
  
function highlightFeature(e) {
    var layer = e.target;

    layer.setStyle({
        weight: 3,
        color: '#ffffff',
        dashArray: '',
        fillOpacity: 0.95
    });

    if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
        layer.bringToFront();
    }
    info.update(layer.feature.properties);
}


function resetHighlight(e) {
    geojson.resetStyle(e.target);
    info.update();
}

function onClick(e) {
    map.fitBounds(e.target.getBounds());
    alert(feature.properties);
}

function onEachFeature(feature, layer) {
    layer.on({
        mouseover: highlightFeature,
        mouseout: resetHighlight,
    });
    layer.on('click', function (e) {
        map.fitBounds(e.target.getBounds());
        
        document.getElementById("chosenMun").innerHTML = "You have selected " + feature.properties.NAMEFIN.bold() + " for the comparison. Click calculate carbon footprint to visualize the results."
    });
    
}

geojson = L.geoJson(kunnat, {
    style: style,
    onEachFeature: onEachFeature
}).addTo(map);


var info = L.control();

info.onAdd = function (map) {
    this._div = L.DomUtil.create('div', 'info');
    this.update();
    return this._div;
};

// method that we will use to update the control based on feature properties passed
info.update = function (props) {
    this._div.innerHTML = (props ?
        '<b>' + props.NAMEFIN + '</b><br />' + props.TOTALAREA + '  km<sup> 2</sup>'
        : 'Hover over a municipality');
};

info.addTo(map);
